INSERT INTO `products` (`id`, `category_id`, `sku`, `name`, `description`, `picture_name`, `price`, `current_discount`, `stock`, `product_unit`, `is_available`, `add_date`) VALUES
(1, 1, 'TTTH450149', 'Teh Teki', 'Khasiat: Membantu memelihara kesehatan pada penderita kanker\r\nDosis Pemakaian: 2x sehari untuk memelihara kesehatan. Bagi yang mengalami gangguan kesehatan atau untuk anak-anak bisa konsultasi lebih lanjut\r\nCara Penyajian:\r\nSiapkan air hangat kurang lebih 750 ml – 1 L dengan suhu 40°C - 50°C\r\nMasukkan 1 sachet diamkan selama ± 10 menit\r\nCara Penyimpanan: Simpan Teh Teki di tempat yang kering, bersih, dan terlindungi dari sinar matahari secara langsung pada suhu di bawah 30°C', 'Teh_Teki1.jpeg', '40000.00', '0.00', 47, 'box', 1, '2022-04-29 15:49:09'),
(2, 3, 'XMCOL250454', 'X3 Man', 'Khasiat: Membantu memelihara kesehatan tubuh\r\nDosis Pemakaian: 1-5 tetes 3x. Bagi yang mengalami gangguan kesehatan atau untuk anak-anak bisa konsultasi lebih lanjut\r\nCara Penyajian:\r\nKocok botol terlebih dahulu sebelum dikonsumsi\r\nDiminum sebelum makan, dapat dicampur dengan air putih, jus, susu, teh, dan lain-lain (tidak panas)\r\nCara Penyimpanan: Setelah dibuka, tutup botol dengan rapat, dan simpan di tempat yang kering, bersih, dan terlindungi dari sinar matahari secara langsung.', 'X3Man1.jpeg', '200000.00', '0.00', 46, 'botol', 1, '2022-04-29 15:54:14'),
(3, 2, 'YCOL550580', 'Yakoli', 'Khasiat: Membantu meredakan gejala masuk angin, seperti perut kembung dan mual\r\nCara Pemakaian:\r\nKocok botol terlebih dahulu sebelum digunakan\r\nDioleskan pada bagian tubuh yang sakit\r\nCara Penyimpanan: Setelah dibuka, tutup botol dengan rapat, dan simpan di tempat yang kering, bersih, dan terlindungi dari sinar matahari secara langsung pada suhu di bawah 30°C', 'Yakoli.jpeg', '55000.00', '0.00', 49, 'botol', 1, '2022-04-29 15:56:20'),
(4, 4, 'BCOD250654', 'Bekatul', 'Komposisi: Terbuat dari bahan alami bekatul atau rice bran\r\nCara Pemakaian:\r\nTuang 1 sachet bekatul ke dalam mangkuk\r\nTambahkan 3 sendok makan air panas\r\nAduk hingga tercampur rata\r\nBekatul siap dinikmati\r\nKunyah hingga terasa manis di mulut dan telan\r\nCara Penyimpanan: Setelah dibuka, tutup botol dengan rapat, dan simpan di tempat yang kering, bersih, dan terlindungi dari sinar matahari secara langsung pada suhu di bawah 30°C', 'Bekatul.jpeg', '20000.00', '0.00', 46, 'box', 1, '2022-04-29 15:57:34'),
(5, 2, 'PWCOL850936', 'Produk W-9', 'Khasiat: Membantu meringankan luka bakar yang ringan seperti kemerahan tanpa melepuh\r\nCara Pemakaian:\r\nKocok botol terlebih dahulu sebelum digunakan\r\nBersihkan luka dengan air, kemudian oleskan W-9 secukupnya\r\nCara Penyimpanan: Setelah dibuka, tutup botol dengan rapat, dan simpan di tempat yang kering, bersih, dan terlindungi dari sinar matahari secara langsung pada suhu di bawah 30°C', 'W-9.jpeg', '80000.00', '0.00', 50, 'Botol', 1, '2022-04-29 16:02:16'),
(6, 3, 'KCOD350986', 'Kisoya', 'Komposisi\r\nCoffe arabica semen\r\nGlycine max semen\r\nCyperus rotundus rhizoma\r\nOryza sativa eyes\r\nCara penyajian\r\n1. Tuangkan 1 sachet KISOYA ke dalam gelas\r\n2. Tambahkan 150 ml air panas, aduk hingga tercampur rata\r\n3. KISOYA siap dinikmati', 'Kisoya.jpeg', '35000.00', '0.00', 49, 'box', 1, '2022-04-29 16:03:06'),
(27, 3, 'TMCOD350248', 'Teh Manggata', 'Khasiat: Membantu memelihara kesehatan pada penderita kanker\r\nDosis Pemakaian: 2x sehari untuk memelihara kesehatan. Bagi yang mengalami gangguan kesehatan atau untuk anak-anak bisa konsultasi lebih lanjut\r\nCara Penyajian:\r\nSiapkan air hangat kurang lebih 750 ml – 1 L dengan suhu 40°C - 50°C\r\nMasukkan 1 sachet diamkan selama ± 10 menit\r\nCara Penyimpanan: Simpan Teh Teki di tempat yang kering, bersih, dan terlindungi dari sinar matahari secara langsung pada suhu di bawah 30°C\r\n', 'Teh_Teki2.jpeg', '30000.00', '0.00', 49, 'box', 1, '2022-06-17 03:27:28');

